import React from "react";
import deleteLogic from "./deleteLogic";

const DeleteButton = ({ apiUrl, id, onDataUpdate, buttonText }) => {
    const handleDelete = () => {
        deleteLogic({ apiUrl, id, onDataUpdate });
    };

    return (
        <p button onClick={handleDelete}>
            {buttonText}
        </p>
    );
};

export default DeleteButton;
